  true,\n\t\"url\": null,\n\t\"notes\": \"THIS DATA ASSET NO LONGER ACTIVE: This is
  metadata documentation for the National Priorities List (NPL) Publication Assistance
  Databsae (PAD), a Lotus Notes application that holds Region 7's universe of NPL
  site information such as site description, threats and contaminants, cleanup approach,
  environmental process, community involvement, site repository, and regional contacts.
  This database used to be updated annually, at different times for different NPLs,
  but it is currently no longer being used.  This work fell under objectives for EPA's
  2003-2008 Strategic Plan (Goal 3) for Land Preservation & Restoration, which are
  to clean up and reuse contaminated land.\",\n\t\"license_title\": \"Other License
